class Solution:
    def checkSubarraySum(self, nums: list[int], k: int) -> bool:
        s = len(nums) - 1
        r = []
        running_sum = 0
        
        for i in range(1, s + 1):
            r.append(nums[i - 1])
            running_sum += nums[i - 1]
            
            if i == s:
                running_sum += nums[i]
                if running_sum % k == 0:
                    return True
                continue
            
            for j in range(i, s + 1):
                r.append(nums[j])
                running_sum += nums[j]
                
                if running_sum % k == 0:
                    return True
                
                running_sum -= r.pop(0)
                
        return False


